import { combineReducers } from 'redux';// รวบรวม state 
import { userReducer } from './userReducer';
import { searchReducer } from './searchReducer';

const rootReducer = combineReducers({
    user: userReducer,
    search: searchReducer,
});

export default rootReducer;
